import "./index.css";
import React from "react";

function About() {
  const aboutText = "Welcome to whereabouts";
  // const author = "Naveen Mandava";
  return (
    <div className="mid-content">
      <h1>About Page</h1>
      <p>{aboutText}</p>
      {/* <p>This page designed by {author}.</p> */}
    </div>
  );
}

export default About;
